Красно-белые от Sports.ru для iOS – неофициальное приложение о футбольном клубе "Спартак", благодаря которому вы всегда будете в курсе происходящего в любимой команде. 

Приложение включает: 

• Новости, анонсы, тексты лучших спортивных журналистов и интервью; 
• Онлайн трансляции матчей и состав команды; 
• Командную статистику во всех турнирах в режиме реального времени; 
• Календари всех турниров и турнирные таблицы; 
• Блоги и материалы пользователей; 
• Фото и видео; 
• Форумы и чаты для общения с другими болельщиками.
